import { TouchableOpacity, Image } from "react-native";

const Icon = ({ onPress, png }) => {
  return (
    <TouchableOpacity onPress={onPress}>
      <Image
        // source={require(`${png}`)}
        source={{ uri: `file://${png}` }}
        // source={require(`../img/log-out.png`)}
        style={{ width: 24, height: 24, marginHorizontal: 25 }}
      />
    </TouchableOpacity>
  );
};

export default Icon;
